def binary_search(lst, number):
    low = 0
    high = len(lst) - 1

    while low <= high:
        mid = (low + high) // 2
        if lst[mid] == number:
            return True
        elif lst[mid] < number:
            low = mid + 1
        else:
            high = mid - 1

    return False

