def is_palindrome(n):
    return str(n) == str(n)[::-1]

def largest_palindromic_number(arr):
    max_length = -1
    max_index = -1

    for i in range(len(arr)):
        if is_palindrome(arr[i]):
            length = len(str(arr[i]))
            if length > max_length:
                max_length = length
                max_index = i

    return max_index

