def merge_sort(arr):
    if len(arr) <= 1:
        return arr

    mid = len(arr) // 2
    left = arr[:mid]
    right = arr[mid:]

    left = merge_sort(left)
    right = merge_sort(right)

    return merge(left, right)

def merge(left, right):
    result = []
    i = j = 0

    while i < len(left) and j < len(right):
        if left[i] > right[j]:
            result.append(left[i])
            i += 1
        else:
            result.append(right[j])
            j += 1

    while i < len(left):
        result.append(left[i])
        i += 1

    while j < len(right):
        result.append(right[j])
        j += 1

    return result

# Test the code
arr = [5, 2, 9, 1, 7, 6]
sorted_arr = merge_sort(arr)
print(sorted_arr)

def find_most_frequent_character(s):
    # Create an empty dictionary to store character counts
    char_counts = {}

    # Iterate through each character in the string
    for char in s:
        # If the character is not already in the dictionary, add it with a count of 1
        if char not in char_counts:
            char_counts[char] = 1
        # If the character is already in the dictionary, increment its count by 1
        else:
            char_counts[char] += 1

    # Find the character with the highest count
    most_frequent_char = None
    highest_count = 0
    for char, count in char_counts.items():
        if count > highest_count:
            most_frequent_char = char
            highest_count = count

    return most_frequent_char

# Test the function
s = "Hello, World!"
most_frequent_char = find_most_frequent_character(s)
print("Most frequent character:", most_frequent_char)

