def bubble_sort(arr):
    n = len(arr)
    for i in range(n - 1):
        # Flag to check if any swap is made in the current iteration
        is_swapped = False
        for j in range(n - i - 1):
            if arr[j] > arr[j + 1]:
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
                is_swapped = True
        # If no swap is made in the current iteration, the array is already sorted
        if not is_swapped:
            break

# Example usage:
arr = [4, 2, 8, 6, 5]
bubble_sort(arr)
print(arr)

