def find_first_occurrence(arr, target, low, high):
    if low > high:
        return -1

    mid = (low + high) // 2

    if arr[mid] == target:
        if mid == 0 or arr[mid - 1] != target:
            return mid
        else:
            return find_first_occurrence(arr, target, low, mid - 1)
    elif arr[mid] < target:
        return find_first_occurrence(arr, target, mid + 1, high)
    else:
        return find_first_occurrence(arr, target, low, mid - 1)


