import math

def find_primes_in_range(start, end):
    isPrime = [True] * (end + 1)
    isPrime[0] = isPrime[1] = False

    for i in range(2, int(math.sqrt(end)) + 1):
        if isPrime[i]:
            for j in range(i * i, end + 1, i):
                isPrime[j] = False

    prime_sum = 0
    for i in range(start, end + 1):
        if isPrime[i]:
            prime_sum += i

    return prime_sum

