def remove_chars(string):
    new_string = ""
    counts = {}

    # Count the occurrences of each lowercase letter
    for char in string:
        if char.islower():
            if char in counts:
                counts[char] += 1
            else:
                counts[char] = 1

    # Remove the first and last occurrence of each lowercase letter
    for char in string:
        if char.islower():
            if char in counts and counts[char] > 1:
                counts[char] -= 1
            else:
                new_string += char
        else:
            new_string += char

