    sentence = sentence.lower()
    words = sentence.split()

    for word in words:
        if len(word) > 2:
            for i in range(1, len(word) - 1):
                if (
                    word[i] in "aeiou"
                    and word[i-1] not in "aeiou"
                    and word[i+1] not in "aeiou"
                ):
                    count += 1

    return count

