def separate_string(string):
    left = ""
    right = ""

    for char in string:
        if char.isdigit():
            left += char
        elif char.islower():
            right += char

    left = quicksort(left)

    if right == "":
        return "", ""

    return left, right

def quicksort(arr):
    if len(arr) <= 1:
        return arr

    pivot = arr[0]
    lesser = [x for x in arr[1:] if x <= pivot]
    greater = [x for x in arr[1:] if x > pivot]

    return quicksort(lesser) + [pivot] + quicksort(greater)

