def calculate_character_frequency(string):
    frequency = {}
    for char in string:
        if char.isalpha():
            char = char.upper()
            frequency[char] = frequency.get(char, 0) + 1
    return dict(sorted(frequency.items(), key=lambda x: -ord(x[0])))

