def sqrt_rounded(n):
    left = 1
    right = n

    while left <= right:
        mid = (left + right) // 2

        if mid * mid == n:
            return mid
        elif mid * mid > n:
            right = mid - 1
        else:
            left = mid + 1

    return right

# Example usage
print(sqrt_rounded(16))  # Output: 4
print(sqrt_rounded(10))  # Output: 3
print(sqrt_rounded(8))   # Output: 3

