    primes = [2, 3, 5, 7]
    if n < 4:
        return primes[:n]
    else:
        # this is a naive way to generate primes and is not efficient for large n
        for num in range(9, n*10, 2):
            is_prime = True
            for i in range(2, int(num**0.5) + 1):
                if num % i == 0:
                    is_prime = False
                    break
            if is_prime:
                primes.append(num)
        return primes

