def sort_numbers(numbers):
    # Iterate through the list
    for i in range(len(numbers)):
        # Iterate through the list again
        for j in range(i+1, len(numbers)):
            # If the current number is smaller than the next number
            if numbers[i] < numbers[j]:
                # Swap the numbers
                numbers[i], numbers[j] = numbers[j], numbers[i]

    # Print the sorted list in descending order
    for number in numbers:
        print(number)

# Example usage
numbers = [3, 5, 1, 4, 2]
sort_numbers(numbers)

def mergeSort(arr):
    if len(arr) <= 1:
        return arr

    mid = len(arr) // 2
    left = mergeSort(arr[:mid])
    right = mergeSort(arr[mid:])

    return merge(left, right)

def merge(left, right):
    result = []
    i = j = 0

    while i < len(left) and j < len(right):
        if left[i] < right[j]:
            result.append(left[i])
            i += 1
        elif left[i] > right[j]:
            result.append(right[j])
            j += 1
        else:
            result.append(left[i])
            i += 1
            j += 1

    while i < len(left):
        result.append(left[i])
        i += 1

    while j < len(right):
        result.append(right[j])
        j += 1

    return result

def removeDuplicates(arr):
    result = []
    visitedSet = set()

    for num in arr:
        if num not in visitedSet:
            visitedSet.add(num)
            result.append(num)

    return result

def mergeAndRemoveDuplicates(arr1, arr2):
    merged = arr1 + arr2
    mergedSorted = mergeSort(merged)
    uniqueSorted = removeDuplicates(mergedSorted)
    return uniqueSorted

