import re

def count_word_frequency(string):
    string = string.lower()
    string = re.sub(r'[^\w\s]', '', string)
    words = string.split()
    frequency = {}

    for word in words:
        if word in frequency:
            frequency[word] += 1
        else:
            frequency[word] = 1

