def find_longest_increasing_subarray(arr):
    max_len = 0
    start_index = -1
    current_len = 0

    for i in range(1, len(arr)):
        if arr[i] > arr[i-1]:
            current_len += 1
        else:
            if current_len >= 3:
                if current_len > max_len:
                    max_len = current_len
                    start_index = i - current_len
            current_len = 1

    if current_len >= 3:
        if current_len > max_len:
            max_len = current_len
            start_index = len(arr) - current_len

    return arr[start_index: start_index + max_len]

