def postfix_to_infix(expression):
    stack = []
    operators = set(['+', '-', '*', '/'])

    for char in expression:
        if char not in operators:
            stack.append(char)
        else:
            operand2 = stack.pop()
            operand1 = stack.pop()
            stack.append('({}{}{})'.format(operand1, char, operand2))

    return stack.pop()

