import pytest

def find_closest_point(points):
    if len(points) == 0:
        raise ValueError("Points list cannot be empty")
    min_distance = float('inf')
    closest_point = None
    for point in points:
        distance = sum(map(lambda x: x**2, point))
        if distance < min_distance:
            min_distance = distance
            closest_point = point
    return closest_point

