    reversed_arr = arr[::-1]
    non_prime_count = {}

    for num in reversed_arr:
        if num not in non_prime_count:
            non_prime_count[num] = 0
        non_prime_count[num] += 1

    for num in reversed_arr:
        if is_prime(num):
            reversed_arr.remove(num)

    return reversed_arr, non_prime_count

