def partition(arr, low, high):
    i = low - 1
    pivot = arr[high]

    for j in range(low, high):
        if arr[j] <= pivot:
            i = i + 1
            arr[i], arr[j] = arr[j], arr[i]

    arr[i + 1], arr[high] = arr[high], arr[i + 1]
    return i + 1

def quicksort(arr, low, high):
    if low < high:
        pivot = partition(arr, low, high)

        quicksort(arr, low, pivot - 1)
        quicksort(arr, pivot + 1, high)

def sort_array(arr):
    quicksort(arr, 0, len(arr) - 1)
    return arr

array = [2, 4, 5, 1, 9, 0]
sorted_array = sort_array(array)
print(sorted_array)

def quick_sort(arr):
    if len(arr) <= 1:
        return arr
    else:
        pivot = arr[0]
        less = [x for x in arr[1:] if x <= pivot]
        greater = [x for x in arr[1:] if x > pivot]
        return quick_sort(less) + [pivot] + quick_sort(greater)

def quick_sort_modified(arr):
    if len(arr) <= 1:
        return arr
    elif arr == sorted(arr):
        middle = len(arr) // 2
        pivot = arr[middle]
        less = [x for x in arr[:middle] if x <= pivot] + [x for x in arr[middle+1:] if x <= pivot]
        greater = [x for x in arr[:middle] if x > pivot] + [x for x in arr[middle+1:] if x > pivot]
        return quick_sort_modified(less) + [pivot] + quick_sort_modified(greater)
    else:
        pivot = arr[0]
        less = [x for x in arr[1:] if x <= pivot]
        greater = [x for x in arr[1:] if x > pivot]
        return quick_sort_modified(less) + [pivot] + quick_sort_modified(greater)

# Test case
